      axios
        .get('https://api.coingecko.com/api/v3/global')
        .then(res => {
        //  console.log(res.data.data)
        const indivCurrencies = res.data.data.total_volume;
        console.log(indivCurrencies);
        setCurrencies(indivCurrencies)

        }).catch(error => {
          console.log(error);
        });
      }

  return (
    <div >
      {currencies.map((item) => {
        <div>{item}</div>
